import { NextResponse } from "next/server";
import nodemailer from "nodemailer";
export const HeaderImage = ``;

export const BgImage = ``;

export async function GET() {
  const products = [
    { id: 1, name: "Product A", price: 100 },
    { id: 2, name: "Product B", price: 200 },
  ];
  return NextResponse.json(products);
}

export async function POST(req) {
  const body = await req.json();
  if (req.method === "POST") {
    const { name, email, fileNumber, photo } = body;

    console.log("photo check", photo);

    // Create a Nodemailer transporter
    const transporter = nodemailer.createTransport({
      service: "gmail",
      auth: {
        user: process.env.EMAIL_HOST_USER,
        pass: process.env.EMAIL_HOST_PASSWORD,
      },
    });

    // Remove the data:image/jpeg;base64, prefix if it exists
    const headerImageBase64 = HeaderImage.replace(
      /^data:image\/[a-z]+;base64,/,
      ""
    );
    const bgImageBase64 = BgImage.replace(/^data:image\/[a-z]+;base64,/, "");
    const photoBase64 = photo.replace(/^data:image\/[a-z]+;base64,/, "");
    const emailHTML = `
    <div style="max-width: 600px; margin: auto; font-family: 'Ysra', Georgia, serif; border: 1px solid #ddd; padding: 20px; color: #003057; background: url('cid:bgImage') no-repeat center center; background-size: cover;">
      
      <!-- Content Container -->
      <div style="position: relative; z-index: 2; background: rgba(255, 255, 255, 0.8); padding: 20px; border-radius: 10px;">
        <!-- Header Image -->
        <img src="cid:headerImage" alt="logo page" style="width: 100%;" />
        
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">Dear customer, ${name}</p>
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">Your request has been received successfully</p>

        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">Application type: Asylum file to Canada</p>
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">The request is currently being processed.</p>
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0; line-height: 1.5;">The file will be prepared and submitted to the Canadian Department of Immigration, and an application for asylum and resettlement will be submitted.</p>
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">We will provide you with all new updates later</p>

        <h2 style="color: #003057; text-align: center; font-size: 24px; margin: 20px 0 10px;">File Processing Number</h2>
        <h1 style="color: #003057; text-align: center; font-size: 32px; margin: 10px 0 20px; font-family: 'Destra', sans-serif;">${fileNumber}</h1>

        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">In order to continue working properly,</p>
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">Please provide us with the necessary power of attorney.</p>
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">By signing the document below in the space provided for you</p>
        <p style="font-size: 18px;font-weight: 600; color: #003057; margin: 15px 0;">And send it to us as a scanned PDF file.</p>


        <!-- Button Container -->
        <div style="text-align: center; display: flex; justify-content: center;   width: 100%;">
        <div style="background: #1e3a8a; padding: 5px 0; text-align: center; margin: 20px auto; width: 100px; white-space: nowrap; display: inline-block; ">
          <p style="margin: 0;">
            <a href="https://dordicklaw.info" style="color: #f1c40f; text-decoration: none; font-size: 16px; font-weight: 600;">Our website</a>
          </p>
        </div>
        </div>
        



        <!-- Contact Info Box -->
        <div style="margin-top: 10px; border: 3px solid #000; padding: 2px; display: flex; align-items: start; background: white; width: 450px; margin: auto; font-family: Arial, sans-serif;">
          <!-- Profile Image Side -->
          <div style="width: 100px; height: 100px; border-radius: 50%; overflow: hidden; margin-right: 15px;">
            <img src="cid:photo" alt="Maria Wilson" style="width: 100%; height: 100%; object-fit: cover;" />
          </div>

          <!-- Contact Details Side with DORDICK vertical text -->
          <div style="flex: 1; display: flex;">
            <div style="writing-mode: vertical-lr; text-orientation: upright; padding: 5px; color: #f1c40f; font-weight: bold; font-size: 14px;">
              DORDICK
            </div>

            <div style="flex: 1; padding-left: 2px;">
              <p style="margin: 3px 0; color: #003057; font-weight: bold; font-size: 18px;">👤 Maria Wilson</p>
              <p style="margin: 3px 0; color: #003057; font-size: 12px;text-decoration: none; ">📧 info@dordicklaw.info</p>
              <p style="margin: 3px 0; color: #003057; font-size: 12px;">📞 8005555595</p>
              <p style="margin: 3px 0; color: #003057; font-size: 12px; white-space: nowrap;">📍 Wood St, Whitehorse, YT Y1A 0A1, Canada</p>
              <p style="margin: 3px 0;"><a href="https://dordicklaw.info/" style="color: #003057; font-size: 12px; text-decoration: none;">🌐 https://dordicklaw.info/</a></p>
            </div>
          </div>
        </div>
      </div>
    </div>
`;

    // Email content with attachments
    const mailOptions = {
      from: process.env.EMAIL_HOST_USER,
      to: email,
      subject: "New Form Submission2",
      html: emailHTML,
      attachments: [
        {
          filename: "header.jpg",
          content: headerImageBase64,
          encoding: "base64",
          cid: "headerImage", // Same as the image src in the HTML
          disposition: "inline", // Add this line
        },
        {
          filename: "BgImage.jpg",
          content: bgImageBase64,
          encoding: "base64",
          cid: "bgImage", // Same as the image src in the HTML
          disposition: "inline", // Add this line
        },
        {
          filename: "photo.png",
          content: photoBase64,
          encoding: "base64",
          cid: "photo", // Same as the image src in the HTML
          disposition: "inline", // Add this line
        },
      ],
    };

    try {
      console.log("Sending email...");
      await transporter.sendMail(mailOptions);
      console.log("Email sent successfully");
      return NextResponse.json(
        { message: "Email sent successfully!", data: body },
        { status: 201 }
      );
    } catch (error) {
      console.error("Error sending email:", error);
      return NextResponse.json(
        { message: "An error occurred while sending the email." },
        { status: 500 }
      );
    }
  } else {
    return NextResponse.json(
      { message: "Invalid request method." },
      { status: 405 }
    );
  }
}
